"""
MABE Sprint 40 Overlay: Metal Recalibration + Physics Infrastructure

Results:
  Metal:    MAE 15.11 -> 2.10, R2=0.86 (110 entries, expanded from 48)
  HG:       MAE 1.31, R2=0.48 (maintained via S37a routing)
  PL:       MAE 1.05 (maintained via S38 routing + offsets)

New modules installed:
  pka_estimator.py:    Henderson-Hasselbalch protonation at pH 7.4
  hbond_classifier.py: 3-tier donor/acceptor subtyping (strong/moderate/weak)
  sasa_burial.py:      PC-based per-compound burial correction
  metal_expansion.py:  +62 entries from Martell & Smith
  calibrated_sprint40.py: Metal params from 110-entry backsolve

Also includes:
  Coulomb sign fix in universal_predictor.py
  3 new PhysicsParameters: epsilon_hbond_strong/moderate/weak
  Updated modality_params.py routing to S40 metal params

Prereqs: bootstrap_sprint37.py + bootstrap_sprint38.py + bootstrap_sprint39.py
"""
import base64, pathlib

FILES = {
    "core/pka_estimator.py": "",
    "core/hbond_classifier.py": "",
    "core/sasa_burial.py": "",
    "core/metal_expansion.py": "",
    "core/calibrated_sprint40.py": "",
    "core/modality_params.py": "",
    "core/universal_predictor.py": "",
    "core/backsolve_engine.py": "",
}

for path, b64 in FILES.items():
    pathlib.Path(path).parent.mkdir(parents=True, exist_ok=True)
    content = base64.b64decode(b64).decode("utf-8")
    with open(path, "w", encoding="utf-8") as f:
        f.write(content)
    print(f"  Updated: {path}")

print()
print("Sprint 40 overlay applied.")
print("  Metal:  MAE=2.10, R2=0.86 (from 15.11)")
print("  HG:     MAE=1.31, R2=0.48 (maintained)")
print("  PL:     MAE=1.05 (maintained, S38 params)")
print()
print("New physics modules:")
print("  from core.pka_estimator import enrich_protonation")
print("  from core.hbond_classifier import enrich_hbond_types")
